/**
 * 路由组件
 */
const Routers = [
    {
        path: '/',
        components: ChatContainer => import('../containers/chat')
    },
    {
        path: '/welcome',
        components: Welcome => import('../components/welcome')
    },
    {
        path: '/message',
        components: ChatMessage => import('../containers/chat/message')
    },
    {
        path: '/mail-list',
        components: MailList => import('../containers/mail-list')
    },
    {
        path: '/setting',
        components: Setting => import('../containers/setting')
    },
    {
        path: '/set-message',
        components: Setting => import('../containers/setting')
    },
    {
        path: '/set-page',
        components: Setting => import('../containers/setting')
    },
    {
        path: '/set-login',
        components: Setting => import('../containers/setting')
    },
    {
        path: '/set-about',
        components: Setting => import('../containers/setting')
    },
    {
        path: '/login',
        components: Login => import('../containers/login/login')
    }
]

export default Routers
